USE [LibertyPower]
GO

If exists (Select * from LIbertypower..Qualifier where Term is NULL and ProductTypeID is null and SignStartDate='2013-10-01 00:00:00.000')
BEGIN
Update LIbertypower..Qualifier set Term=24 , ProductTypeId=1, SignStartDate='10/23/2013' where Term= NULL and ProductTypeID=null and SignStartDate='2013-10-01 00:00:00.000'
END
GO

If exists (Select * from LIbertypower..Qualifier where UtilityID is NULL )
BEGIN
Update LibertyPower..Qualifier Set utilityID=13 where UtilityID is NULL
END
GO




